import { useEffect, useState } from "react";
import { Table } from "react-bootstrap";

const LoadDataToTable = () => {

    const [persons, setPerson] = useState([]);
    const [type, setType] = [1,2,3,4];

    useEffect(() => {
        fetch(`https://dummyjson.com/users/${type}`)
        .then(res => res.json())
        .then(json => {
            setPerson(json.users);
            setType(type);
        });
    },[type]);

    return (
        <Table striped bordered hover>
            <thead>
                <tr>
                    <th>
                        Id
                    </th>
                    <th>
                        Name
                    </th>
                    <th>
                        Age
                    </th>
                    <th>
                        Action
                    </th>
                </tr>
            </thead>
            <tbody>
                {
                    persons.map(({ id, firstName, age }) =>
                        <tr key={id}>
                            <td>
                                {id}
                            </td>
                            <td>
                                {firstName}
                            </td>
                            <td>
                                {age}
                            </td>
                            <td>
                                <button>
                                    Edit
                                </button>
                                <button>
                                    Delete
                                </button>
                            </td>
                        </tr>)
                }
            </tbody>
        </Table>
    );
}

export default LoadDataToTable;
